webpackJsonp([0x9214b7ff9159],{391:function(e,i){e.exports={data:{markdownRemark:{html:'<h1 id="faq"><a href="#faq" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>FAQ</h1>\n<!-- MarkdownTOC depth=1 autolink=true bracket=round -->\n<ul>\n<li><a href="#what-is-the-primary-feature-of-frintjs">What is the primary feature of FrintJS?</a></li>\n<li><a href="#where-can-i-use-frintjs">Where can I use FrintJS?</a></li>\n<li><a href="#do-i-need-to-learn-rxjs-to-use-frintjs">Do I need to learn RxJS to use FrintJS?</a></li>\n<li><a href="#is-frintjs-a-replacement-for-react">Is FrintJS a replacement for React?</a></li>\n<li><a href="#can-i-use-frintjs-only-with-react">Can I use FrintJS only with React?</a></li>\n<li><a href="#is-frintjs-a-redux-alternative">Is FrintJS a Redux alternative?</a></li>\n<li><a href="#can-i-use-redux-with-frintjs">Can I use Redux with FrintJS?</a></li>\n</ul>\n<!-- /MarkdownTOC -->\n<h2 id="what-is-the-primary-feature-of-frintjs"><a href="#what-is-the-primary-feature-of-frintjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>What is the primary feature of FrintJS?</h2>\n<p>The <code>frint</code> package primarily handles:</p>\n<ul>\n<li>Dependency injection (providers) in Apps</li>\n<li>Child App registrations</li>\n</ul>\n<p>The core of the framework is intentionally kept as simple as possible, allowing other tools/packages to be built around it.</p>\n<h2 id="where-can-i-use-frintjs"><a href="#where-can-i-use-frintjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Where can I use FrintJS?</h2>\n<p>The framework is evironment agnostic. You can run it in the browser, server or CLI (with Node.js).</p>\n<h2 id="do-i-need-to-learn-rxjs-to-use-frintjs"><a href="#do-i-need-to-learn-rxjs-to-use-frintjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Do I need to learn RxJS to use FrintJS?</h2>\n<p>Understanding the <a href="../../guides/observables">basic concepts</a> would really help. We don\'t expect you to learn everything about <a href="http://reactivex.io/rxjs/">RxJS</a>, but understanding the asynchronous nature of Observables and that they support emitting multiple values over time will help you use FrintJS more efficiently.</p>\n<p>To make it easier for beginners, we even ship helper functions like <code>streamProps</code> from our <code>frint-react</code> package.</p>\n<h2 id="is-frintjs-a-replacement-for-react"><a href="#is-frintjs-a-replacement-for-react" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Is FrintJS a replacement for React?</h2>\n<p>The package <code>frint</code> itself has nothing to do with rendering. In fact, the core of the framework is environment agnostic, and can run in CLI, browser or even server.</p>\n<p>The core\'s primary responsibilities include:</p>\n<ul>\n<li>Handling <a href="../../guides/providers">providers</a> (dependency injection)</li>\n<li>Registration of apps</li>\n<li>Inter-app communication</li>\n</ul>\n<p>It is only with additional packages like <code>frint-react</code> that we connect FrintJS with <a href="https://reactjs.org/">React</a>.</p>\n<h2 id="can-i-use-frintjs-only-with-react"><a href="#can-i-use-frintjs-only-with-react" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Can I use FrintJS only with React?</h2>\n<p>FrintJS is rendering library agnostic. The core is not built with any specific rendering library in mind. We do support React officially with <code>frint-react</code>, because we are users of React ourselves, but it can be easily connected to almost any other reactive rendering library.</p>\n<p>For example, there is <a href="https://github.com/frintjs/frint-vue"><code>frint-vue</code></a> for using FrintJS with <a href="https://vuejs.org/">Vue.js</a>.</p>\n<h2 id="is-frintjs-a-redux-alternative"><a href="#is-frintjs-a-redux-alternative" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Is FrintJS a Redux alternative?</h2>\n<p><a href="http://redux.js.org/">Redux</a> is purely for state management. While FrintJS is mostly concerned with structuring your app with providers (dependencies).</p>\n<p>We do have a package called <code>frint-store</code>, which is an implementation of Redux (with less features) using similar API using RxJS. But it is never required for you to use any specific state management library to use FrintJS.</p>\n<p>You are free to use whatever you like for state management.</p>\n<h2 id="can-i-use-redux-with-frintjs"><a href="#can-i-use-redux-with-frintjs" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Can I use Redux with FrintJS?</h2>\n<p>Of course you can! It is a matter of only setting your Redux store as a provider in your App.</p>\n<p>You can read more about the implementation details in this <a href="https://medium.com/frintjs/using-frintjs-with-react-js-and-redux-823ad7cdbc02">blog post</a>.</p>',frontmatter:{path:"/docs/faq",title:"FAQ",importFromGitHub:null}}},pathContext:{}}}});
